  false,\n\t\"url\": null,\n\t\"notes\": \"Publication on the Atlantic Coastal plain
  Geothermal Drilling Program and date for the five (5) test holes drilled in Delaware.Intermittent
  drilling operations were carried out in Delaware. beginning on September 7, 1978
  and completed November 10, 1978. During that period five wells were drilled to approximately
  1000 feet and cased with 4!a\" seamless casing cemented to the surface. Each hole
  was completed by installation of wellhead equipment to permit geothermal test measurements
  and filling the hole with water containing corrosion inhibitor.\",\n\t\"license_title\":
